[{"id":"202733","published":true,"test":false,"name":"Hosteria Hainen","hotel_type":{"id":"HOT"},"stars":0,"location":{"city":{"id":"2346"},"address":"Puerto Deseado 118","zipcode":"9405","latitude":-50.333902796486190,"longitude":-72.255130769805870},"checkin":{"from":"15:00"},"checkout":{"to":"11:00"},"information":{"es":"Ubicada sobre una loma con vista a la Cordillera de los Andes, la Hostería Hainen está a 15 minutos a pie del centro de El Calafate, a 78 km del Glaciar Perito Moreno y a 20 minutos en auto del Aeropuerto Internacional Comandante Armando Tola. Dispone de Wi-Fi gratuito en toda la propiedad.\n\nConstruida en madera y con un jardín arbolado, la hostería dispone de personal 24h listo para brindar información sobre paseos turísticos. Cuenta con biblioteca, salón de juegos, computadoras a disposición y guarda-equipajes. \n\nLas habitaciones están calefaccionadas y equipadas con TV de pantalla plana por cable, minibar y caja de seguridad, además de baño privado con secador de cabello. \n\nEn el establecimiento se sirve un desayuno continental que incluye yogur, cereales, panificados e infusiones calientes, además de masas artesanales, alfajores, tortas dulces y frutas de estación. Se pueden solicitar viandas para las excursiones. \n\nLos huéspedes de Hostería Hainen estarán a 2 km de la Reserva de Avifauna Laguna Nimez, a 8 km del Museo del Hielo, Glaciarium, y a 45 minutos en auto de Punta Bandera, donde inician las excursiones al Glaciar Upsala y la Estancia Cristina. El Chaltén queda a 3h25 en auto."},"amenities":[{"id":"WAKEUP"},{"id":"BAR"},{"id":"R24"},{"id":"SERCON"},{"id":"TRANSER"},{"id":"AIRTRAN"},{"id":"CFGU"},{"id":"INGRAH"},{"id":"SEC24"},{"id":"GARD"},{"id":"BREAKFST"},{"id":"PARKING"},{"id":"HOT"},{"id":"LUGFR"},{"id":"GAMES"},{"id":"ROOMSVC"},{"id":"LASESU"},{"id":"TOASAB"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/8a4d0b4f-d737-4bdc-8113-f6b73d87b0be","id":"8a4d0b4f-d737-4bdc-8113-f6b73d87b0be","width":1920,"