0,"longitude":-72.253711542327890},"checkin":{"from":"14:00"},"checkout":{"from":"10:00","to":"10:00"},"information":{"es":"Situado en una colina, con vista panorámica al Lago Argentino, El Marcopolo Suites Calafate se encuentra a 1.5 km de la Terminal de ómnibus de El Calafate, a 20 minutos en auto del Aeropuerto Internacional Comandante Armando Tola y, a través de escaleras públicas, a 1 km del centro. Dispone de Wi-Fi gratuito y personal 24h apto para brindar información.\n\nEl desayuno buffet, incluido en la tarifa, se compone de cruasanes, panes, cereales y yogur, además de infusiones calientes y jugo. A la hora de la cena, el restaurante prepara platos variados. El hotel también alberga un bar.\n\nLas habitaciones, accesibles por escalera, están equipadas con camas sommier, TV por cable, calefacción y caja de seguridad. El baño incluye secador de cabello y bañera. Hay unidades con vista al Lago Argentino, sujetas a disponibilidad.\n\nLos huéspedes del Marcopolo Suites Calafate pueden observar aves en la Reserva Laguna Nimez, a 2.5 km, visitar el Museo de Hielo Glaciarium, a 8 km, o el Bosque Petrificado La Leona, a 103 km. El Glaciar Perito Moreno está a 79 km mientras que Punta Bandera, donde parten embarcaciones al Glaciar Upsala, queda a 49 km. \n\nEl establecimiento cuenta con guarda-equipajes, computadoras a disposición de los huéspedes y salón de TV. Por un cargo extra, ofrece lavandería y traslados al aeropuerto."},"amenities":[{"id":"WAKEUP"},{"id":"BAR"},{"id":"TVROOM"},{"id":"R24"},{"id":"AIRTRAN"},{"id":"CFGU"},{"id":"INGRAH"},{"id":"GARD"},{"id":"BREAKFST"},{"id":"PARKING"},{"id":"HOT"},{"id":"LUGFR"},{"id":"ROOMSVC"},{"id":"LASESU"},{"id":"TOASAB"},{"id":"RESTO"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/0478edcc-ad4f-48ec-88f7-05ccb677f5ac","id":"0478edcc-ad4f-48ec-88f7-05ccb677f5ac","width":2166,"height":1420,"order":0,"picture_category":{"id":"1"}},"pictures":[{"url":"http://media.staticontent.com/media/pictures/0478e