na, La Cantera Boutique Hotel Calafate dispone de balcón con vista panorámica al Lago Argentino y a las montañas, servicio de traslado gratuito hacia el centro comercial, situado a 1.5 km, y personal 24h apto para brindar asesoramiento. Está a 21 km del Aeropuerto Internacional Comandante Armando Tola.\n\nLos huéspedes se deleitarán con un desayuno buffet que incluye variedad de pasteles, fiambres, huevos revueltos, frutas secas y champagne. El restaurante se especializa en cocina patagónica, con ingredientes como cordero, trucha y salmón, mientras que el bar ofrece licores y vinos seleccionados. Se ofrecen viandas para excursiones. \n\nLas habitaciones tienen vista al lago o a las montañas. Están equipadas con calefacción, TV LCD por cable, sillón de descanso y bañera. Las unidades con vista a las montañas poseen balcón, las que ofrecen vista al lago son más amplias y cuentan con bañera de hidromasaje y minibar. \n\nEl hotel proporciona dispone de computadoras para uso de los huéspedes y guarda-equipajes. El estacionamiento es descubierto y gratuito. \n\nQuienes se alojen en La Cantera Hotel puede visitar el Glaciar Perito Moreno, a 80 km, o el Museo de Hielo Glaciarium, a 7 km. Punta Bandera, punto de inicio para conocer el Glaciar Upsala, está a 48 km y el Bosque Petrificado La Leona queda a 105 km."},"notices":{"es":"El servicio de traslado gratuito desde y hacia el centro comercial funciona todos los días de 19h a 23h. / El establecimiento tiene acceso por escalera."},"amenities":[{"id":"WAKEUP"},{"id":"BAR"},{"id":"R24"},{"id":"SERCON"},{"id":"TRANSER"},{"id":"CAR"},{"id":"INGRAH"},{"id":"SOL"},{"id":"BREAKFST"},{"id":"PARKING"},{"id":"TRANSFREE"},{"id":"HOT"},{"id":"LUGFR"},{"id":"LASESU"},{"id":"TOASAB"},{"id":"RESTO"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/449bc64b-aa25-4835-b1cd-fbffbc340612","id":"449bc64b-aa25-4835-b1cd-fbffbc340612","width":3008,"height":2000,"order":0,"picture_category":{"id":"1"}},"pictures":[{"url":"http