_date":"2016-02-12T06:40:21.000Z"},{"id":"331095","published":true,"test":false,"name":"Hotel Picos Del Sur","hotel_type":{"id":"HOT"},"stars":3,"location":{"city":{"id":"2346"},"address":"Puerto San Julián 271, 9405 Santa Cruz, Argentina","zipcode":"9405","latitude":-50.334689607063440,"longitude":-72.253714390213020},"checkin":{"from":"14:00"},"checkout":{"to":"10:00"},"information":{"es":"El Hotel Picos del Sur, ubicado a 10 minutos a pie del centro de El Calafate y a 76 km del Glaciar Perito Moreno, posee un deck de madera con vistas a la Precordillera de Los Andes, personal 24h dispuesto a brindar asesoramiento y Wi-Fi gratuito. Se sitúa a 20 minutos en auto del Aeropuerto Internacional Comandante Armando Tola.\n\nLas habitaciones tienen vista al lago o a las montañas. Están equipadas con TV por cable, calefacción central y caja de seguridad. El baño incluye bañera y secador de cabello. Algunas unidades disponen de zona de estar con sofá-cama, minibar y TV LCD.\n\nEn Picos del Sur, el desayuno buffet incluye panadería artesanal, tartas dulces, medialunas y mermeladas, además de yogures, cereales y bebidas frías y calientes. Para la cena, el restaurante ofrece platos de cocina argentina y regional. El hotel también tiene un bar donde se sirven aperitivos, y se preparan viandas para las excursiones. \n\nLos huéspedes del Picos del Sur pueden observar aves en la Reserva Laguna Nimez, a 2 km, o caminar por las orillas del Lago Argentino, a 3 km. El hotel está a 8 km del Museo de Hielo Glaciarium y a 103 km del Bosque Petrificado La Leona.\n\nLa propiedad dispone de estacionamiento gratuito, jardín y salón de TV. Brinda guarda-equipajes, computadoras para uso común y servicio de lavandería por un costo adicional."},"amenities":[{"id":"WAKEUP"},{"id":"BAR"},{"id":"TVROOM"},{"id":"R24"},{"id":"DRCLSE"},{"id":"TRANSER"},{"id":"CFGU"},{"id":"INGRAH"},{"id":"INTGR"},{"id":"GARD"},{"id":"BREAKFST"},{"id":"PARKING"},{"id":"HOT"},{"id":"INV"},{"id":"LUGFR"},{"id":"ISV"},{"i