ncia dada a nuestros huéspedes, donde cada uno de ustedes es único y recibirá la atención cordial, amable y respetuosa que se merecen en el marco de un cálido y acogedor ambiente familiar, atendido por sus propios dueños en virtud de brindarle una grata e inolvidable estadía.\n\nUsted podrá disfrutar de nuestro estilo, donde una delicada mesa preparada para usted le ofrecerá cada mañana un desayuno con diferentes variedades de jugos, tartas, tortas, masitas, scones, dulces regionales, tostadas de pan casero, frutas, yogures y cereales, acompañados por un rico café o chocolate caliente; o tal vez disfrutar de nuestras variedades de té regionales.\n\nEn nuestro Bar encontrará una amplia variedad de tragos y bebidas en una cálida sala de estar, que se convierte en un agradable lugar de encuentro y descanso.\n\nAl final del día lo espera el cálido y acogedor ambiente de nuestro Restaurant, donde podrá disfrutar en familia o con amigos de momentos únicos, con una vista privilegiada del Lago Argentino, degustará platos regionales y los más exquisitos platos de la cocina internacional.\nTambién contamos con ducha filandesa, hidromasaje y un mini Gym. \nLas 25 habitaciones que cuenta el hotel están cálidamente decoradas y completamente equipadas con Sommiers, TV. Cable Satelital, Cofre de seguridad, Calefacción central y Tel. DDN.DDI.\n\nTodo esto se conjuga para que su velada sea simplemente... inolvidable."},"amenities":[{"id":"WAKEUP"},{"id":"JCZHTL"},{"id":"BAR"},{"id":"TVROOM"},{"id":"R24"},{"id":"TRANSER"},{"id":"CAR"},{"id":"GIM"},{"id":"STORE"},{"id":"INGRAH"},{"id":"GARD"},{"id":"BREAKFST"},{"id":"HOT"},{"id":"PARKADCO"},{"id":"INV"},{"id":"GAMES"},{"id":"LASESU"},{"id":"ROOMSVC"},{"id":"TOASAB"},{"id":"RESTO"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/6505145c-9a09-45ce-a2d9-6bf4757517e8","id":"6505145c-9a09-45ce-a2d9-6bf4757517e8","width":2832,"height":2128,"order":0,"picture_category":{"id":"0"}},"pictures":[{"url":"http://media.static