cf151e8d687","width":414,"height":316,"order":2,"picture_category":{"id":"100"}},{"url":"http://media.staticontent.com/media/pictures/ab2e7065-038e-4e82-adca-150d3d5a5ff1","id":"ab2e7065-038e-4e82-adca-150d3d5a5ff1","width":400,"height":416,"order":3,"picture_category":{"id":"100"}}],"creation_date":"2014-01-01T00:00:00.000Z","last_modified_date":"2014-01-01T00:00:00.000Z"}],"creation_date":"2012-10-11T12:52:46.000Z","last_modified_date":"2016-02-12T06:41:41.000Z"},{"id":"359560","published":true,"test":false,"name":"Hostel del Glaciar Libertador","hotel_type":{"id":"HST"},"stars":0,"location":{"city":{"id":"2346"},"address":"Avenida Libertador 587","zipcode":"9405","latitude":-50.338953976224290,"longitude":-72.255954962565620},"checkin":{"from":"14:30","to":"03:00"},"checkout":{"from":"04:00","to":"10:00"},"information":{"es":"Hostel del Glaciar Libertador está localizado en la Avenida San Martín, calle principal de El Calafate. Hay bares y restaurantes a 500 metros de la propiedad. El Aeropuerto Internacional Armando Tola está a 30 minutos en auto. El hostel dispone de Wi-Fi gratuito en zonas comunes y calefacción por piso radiante.\n\nLas habitaciones pueden ser privadas o compartidas. Todas poseen baño privado sub-compartimentado. En el caso de las habitaciones compartidas se proveen lockers individuales.\n\nHostel del Glaciar pone a disposición una cocina equipada y propone espacios comunes para usar como un patio trasero con asador y un mini-cine. Se ofrece café las 24 hs. \n\nEl establecimiento cuenta con un salón donde se sirve un desayuno no incluido en la tarifa. Consiste de panes y budines caseros, frutas, dulces y cereales. \n\nDesde El Calafate se realizan excursiones hacia los Glaciares Perito Moreno y Upsala. El hostel está a 15 km de la aerosilla del Cerro Huyliche. Es posible visitar el Centro de Interpretación Glaciarium y, a 60 km del hostel, hacer trekking al Cerro Cristal.\n\nNota: \n\nLas tarifas no reembolsables serán cobradas en su totalidad al momento de efectuar la reserva\n\nEl horario de check-in es a las 14.30 horas sin excepción. El servicio comienza en ese horario y finaliza a las 10 horas del día siguiente. Por cortesía podrá quedarse sin costo adicional hasta las 14:30 en las áreas públicas del hostel."},"amenities":[{"id":"WAKEUP"},{"id":"TVROOM"},{"id":"R24"},{"id":"PAREFR"},{"id":"TRANSER"},{"id":"AIRTRAN"},{"id":"SHKI"},{"id":"LOCKS"},{"id":"INGRAH"},{"id":"INTGR"},{"id":"ASAD"},{"id":"BREEXCH"},{"id":"BREAKFST"},{"id":"HOT"},{"id":"SMPEALFR"},{"id":"LUGFR"},{"id":"LASESU"},{"id":"TOASAB"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/f2e508ad-661d-44e6-833d-f23357f5eabf","id":"f2e508ad-661d-44e6-833d-f23357f5eabf","width":2048,"height":1479,"order":0,"picture_category":{"id":"0"}},"pictures":[{"url":"http://media.staticontent.com/media/pictures/f2e508ad-661d-44e6-833d-f23357f5eabf","id":"f2e508ad-661d-44e6-833d-f23357f5eabf","width":2048,"height":1479,"order":0,"picture_category":{"id":"0"}},{"url":"http://media.staticontent.com/media/pictures/bdaede8a-7d19-46a2-a42c-369c85cbf7cb","id":"bdaede8a-7d19-46a2-a42c-369c85cbf7cb","width":5184,"height":3456,"order":1,"picture_category":{"id":"0"}},{"url":"http://media.staticontent.com/media/pictures/29a7eefc-f169-4852-9ab8-de327da5e650","id":"29a7eefc-f169-4852-9ab8-de327da5e650","width":570,"height":400,"order":2,"picture_category":{"id":"20"}},{"url":"http://media.staticontent.com/media/pictures/d42d0a8c-cc72-42c7-a336-541cd8e9f80e","id":"d42d0a8c-cc72-42c7-a336-541cd8e9f80e","width":1280,"height":960,"order":3,"picture_category":{"id":"0"}},{"url":"http://media.staticontent.com/media/pictures/b723c05f-c536-4338-93ea-5bf0d75b18b1","id":"b723c05f-c536-4338-93ea-5bf0d75b18b1","width":640,"height":480,"order":4,"picture_category":{"id":"0"}},{"url":"http://media.staticontent.com/media/pictures/e7fab06f-a53b-40f2-b52b-50c4c79f1873","id":"e7fab06f-a53b-40f2-b52b-50c4c79f1873","width":570,"height":400,"order":5,"picture_catego