 la principal de El Calafate. Está a 600 m del Lago Argentino y a 21 km del Aeropuerto Internacional Comandante Armando Tola. \n\nLos alojamientos cuentan con TV por cable. Las habitaciones disponen de caja de seguridad, bañera y secador de cabello. Las cabañas poseen cocina-comedor con fogón, horno, un pequeño refrigerador y microondas, además de asador compartido, TV de pantalla plana y baño con ducha. Se pueden solicitar ventiladores de pie, bajo disponibilidad.\n\nEl establecimiento proporciona Wi-Fi y estacionamiento, ambos gratuitos y posee guarda-equipajes. La recepción funciona 24h, el servicio de limpieza es diario y se ofrece lavandería por un suplemento.\n\nLos huéspedes de Don Pepe El Calafate están a 6 km del Museo del Hielo Glaciarium y a 1.5 km de la Reserva Ecológica Laguna Nimez. El Glaciar Perito Moreno se encuentra a 78 km y la Terminal de ómnibus, a 10 minutos caminando.\n\nEl desayuno difiere según la categoría. Para las habitaciones es buffet e incluye infusiones calientes, yogur y cereales, además de panes, budines y medialunas. En los bungalows, el desayuno es seco y se entrega el día previo. Se compone de café y leche en polvo, panes y productos untables."},"amenities":[{"id":"R24"},{"id":"PAREFR"},{"id":"MNA"},{"id":"CAR"},{"id":"INGRAH"},{"id":"ASAD"},{"id":"BREAKFST"},{"id":"GARD"},{"id":"PARKING"},{"id":"HOT"},{"id":"LUGFR"},{"id":"ROOMSVC"},{"id":"LASESU"},{"id":"TOASAB"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/19b8c324-89da-4aed-928c-44987f24d33e","id":"19b8c324-89da-4aed-928c-44987f24d33e","width":1920,"height":1254,"order":0,"picture_category":{"id":"1"}},"pictures":[{"url":"http://media.staticontent.com/media/pictures/19b8c324-89da-4aed-928c-44987f24d33e","id":"19b8c324-89da-4aed-928c-44987f24d33e","width":1920,"height":1254,"order":0,"picture_category":{"id":"1"}},{"url":"http://media.staticontent.com/media/pictures/76249800-18f4-45f0-bc7a-a0dc61eefd50","id":"76249800-18f4-45f0-bc7a-a0dc61eefd50","width