iones están equipadas con TV LCD por cable, calefacción, caja de seguridad y minibar. El baño es en suite y posee bañera y secador de cabello.\n\nEl desayuno buffet incluye variedad de fiambres, panificados dulces, medialunas e infusiones calientes, además de yogures y cereales. Usted también podrá solicitar comidas y snacks en el Resto Bar. \n\nEl establecimiento cuenta con recepción y seguridad 24h, además de estacionamiento gratuito y guarda-equipajes. Se ofrecen servicios de traslados y lavandería por un costo adicional. \n\nLos huéspedes del Cyan Cacique Calafate podrán visitar el Bosque Petrificado La Leona, a 102 km, o arribar a Punta Bandera, a 48 km, donde parten excursiones hacia la Estancia Cristina y el Glaciar Upsala. El Museo del Hielo Patagónico, Glaciarium, queda a 8.5 km."},"amenities":[{"id":"WAKEUP"},{"id":"BAR"},{"id":"R24"},{"id":"SERCON"},{"id":"DRCLSE"},{"id":"TRANSER"},{"id":"AIRTRAN"},{"id":"INGRAH"},{"id":"SEC24"},{"id":"BREAKFST"},{"id":"PARKING"},{"id":"HOT"},{"id":"LUGFR"},{"id":"LASESU"},{"id":"TOASAB"},{"id":"RESTO"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/0af9f937-630a-4002-8a17-d08a4aa51666","id":"0af9f937-630a-4002-8a17-d08a4aa51666","width":4288,"height":2848,"order":0,"picture_category":{"id":"20"}},"pictures":[{"url":"http://media.staticontent.com/media/pictures/0af9f937-630a-4002-8a17-d08a4aa51666","id":"0af9f937-630a-4002-8a17-d08a4aa51666","width":4288,"height":2848,"order":0,"picture_category":{"id":"20"}},{"url":"http://media.staticontent.com/media/pictures/627040e2-8550-4e5d-ba14-7755c8ca65a4","id":"627040e2-8550-4e5d-ba14-7755c8ca65a4","width":4288,"height":2848,"order":1,"picture_category":{"id":"6"}},{"url":"http://media.staticontent.com/media/pictures/9c25ede6-56fa-44b2-8b9b-c5242b85ee97","id":"9c25ede6-56fa-44b2-8b9b-c5242b85ee97","width":4288,"height":2848,"order":2,"picture_category":{"id":"6"}},{"url":"http://media.staticontent.com/media/pictures/faf9b141-57e2-4062-9d06-1d1417ad4c4a","id